$(document).ready(function(){var n=[],t;$.get("/Guns/IndexData",function(t){n=$.parseJSON(t)});console.log(n);$("#guns-index-table").DataTable({ajax:n,columns:[{guns:"name"}]}),function(){}();t=$("#searchResults");$("#gunname").on("keyup",function(){t.empty();var n=$(this).val();$.get("GunNameSearch?ss="+n,function(n){for(var r=$.parseJSON(n),i=0;i<r.length;i++)t.append("<div class='row'> <div class='col-md-1'>"+r[i].Level+"<\/div> <div class='col-md-4'>"+r[i].Name+"<\/div> <div class='col-md-2'>"+r[i].DamageOnTarget+"<\/div> <div class='col-md-2'>"+r[i].AllTypesDamageOnTargetRank+"<\/div> <\/div>")})});$("#damage, #accuracy,  #firerate, #reloadspeed, #magazinesize, #elementalDamagePerSecond, #chance").on("keyup",function(){var n=$("#damage").val(),t=$("#accuracy").val(),i=$("#firerate").val(),r=$("#reloadspeed").val(),u=$("#magazinesize").val(),f=$("#elementalDamagePerSecond").val(),e=$("#chance").val();$.get("GunCalcs?damage="+n+"&accuracy="+t+"&firerate="+i+"&reloadspeed="+r+"&magazinesize="+u+"&elementalDamagePerSecond="+f+"&chance="+e,function(n){var t=$.parseJSON(n);$("#damageTimesFireRate").val(t.DamageTimesFireRate);$("#damageTimesFireRateTimesMagazineSize").val(t.DamageTimesFireRateTimesMagazineSize);$("#damageTimesFireRateTimesMagazineSizePerReloadSpeed").val(t.DamageTimesFireRateTimesMagazineSizePerReloadSpeed);$("#damageOnTarget").val(t.DamageOnTarget);$("#elementalDamagePerSecondTimesChance").val(t.ElementalDamagePerSecondTimesChance);$("#elementalDamageOnTargetTimesDamagePerSecondTimesChance").val(t.ElementalDamageOnTargetTimesDamagePerSecondTimesChance)})})});